    "lake-andes-wetland-district-narrative-report-january-1-through-december-31-1970",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Lake Andes
    Wetlands District outlines Refuge accomplishments during the 1970 calendar year.
    The report begins by summarizing the weather conditions, habitat conditions, water
    conditions, and food and cover conditions during the year. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, mammals,
    reptiles, and diseases- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, collections and receipts, and
    vegetation control. Resource management is outlined; topics include fur harvesting.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes Refuge visitors, Refuge participation,
    hunting, violations, and safety. Items of interest, N-R forms, and photographs are
    attached.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
